script: |
  super -f text -I q11996.spq | sort > q11996.out

inputs:
  - name: q11996.spq
    data: |
      SELECT DISTINCT + col1 FROM tab2 (FORMAT parquet) WHERE NOT + col2 NOT IN ( + CAST ( col1 AS INTEGER ), - col1 + - col2 - + - col1 * + col1 );
  - name: tab2

outputs:
  - name: q11996.out
    data: |
